        (function() {
  window.CNN.helpers.addScriptTag({
    src: window.CNN.helpers.getAdfuelSrc(),
    async: true,
    data: {
      uid: 'adfuel'
    },
    onload: () => {
      return window.dispatchEvent(new CustomEvent('adfuel.loaded'));
    }
  });

  const observer = new MutationObserver(function() {
    if (document.body) {
      window.CNN.helpers.addScriptTag({
        src: window.CNN.helpers.getAdfuelSrc(true),
        async: true,
        data: {
          uid: 'adfuel-body'
        },
        onload: () => {
          return window.dispatchEvent(new CustomEvent('adfuel-body.loaded'));
        }
      });
      observer.disconnect();
    }
  });
  observer.observe(document.documentElement, {childList: true});
})();

        

